        [TestMethod]
        public void ThreeSum_01_Empty_array()
        {
            var input = new int[] {};
            var output = new List<List<int>>();

            Extensions<int>.ShouldEqual(ThreeSum.ThreeSum(input), output);
        }

        [TestMethod]
        public void ThreeSum_02_Short_array()
        {
            var input = new int[] {-1, 1};
            var output = new List<List<int>>();

            Extensions<int>.ShouldEqual(ThreeSum.ThreeSum(input), output);
        }

        [TestMethod]
        public void ThreeSum_03_Regular_test()
        {
            var input = new[] {-1, 0, 1, 2, -1, -4};
            var output = new List<List<int>>
            {
                new List<int> {-1, -1, 2},
                new List<int> {-1, 0, 1}
            };

            Extensions<int>.ShouldContainAll(ThreeSum.ThreeSum(input), output);
        }

        [TestMethod]
        public void ThreeSum_04_Regular_test()
        {
            var input = new[] { 0, -4, -1, -4, -2, -3, 2 };
            var output = new List<List<int>>
            {
                new List<int> {-2, 0, 2}
            };

            Extensions<int>.ShouldContainAll(ThreeSum.ThreeSum(input), output);
        }

