        public void ThreeSum_05_Regular_test()
        {
            var input = new[] { -4, -2, -2, -2, 0, 1, 2, 2, 2, 3, 3, 4, 4, 6, 6 };
            var output = new List<List<int>>
            {
                new List<int> {-4, -2, 6},
                new List<int> {-4, 0, 4},
                new List<int> {-4, 1, 3},
                new List<int> {-4, 2, 2},
                new List<int> {-2, -2, 4},
                new List<int> {-2, 0, 2}
            };

            Extensions<int>.ShouldContainAll(ThreeSum.ThreeSum(input), output);
        }

